void keyPressed() {
  if (key == 'w' || key == 'W') isMoving[0] = true;
  else if (key == 'a' || key == 'A') isMoving[1] = true;
  else if (key == 's' || key == 'S') isMoving[2] = true;
  else if (key == 'd' || key == 'D') isMoving[3] = true;
  else if (key == 'c' || key == 'C') {
    currentAttackMode = (currentAttackMode + 1) % 2;
  }
  if (key == TAB) {
    isUIVisible = !isUIVisible;
    if (isUIVisible) {
      // Reset the UI states when it becomes visible
      showMainUI = false;
      showOptionsUI = false;
    }
  }
}

// Function to handle key releases
void keyReleased() {
  if (key == 'w' || key == 'W') isMoving[0] = false;
  else if (key == 'a' || key == 'A') isMoving[1] = false;
  else if (key == 's' || key == 'S') isMoving[2] = false;
  else if (key == 'd' || key == 'D') isMoving[3] = false;
}

// Declare angle, lastMouseX, and lastMouseY as global variables
float angle;
float lastMouseX;
float lastMouseY;

void mousePressed() {
  if (isPlayerAlive && millis() - lastAmmoRespawnTime > ammoRespawnInterval) {
    // Calculate the angle based on the mouse position
    angle = atan2(mouseY - playerY, mouseX - playerX);

    // Store the last mouse position
    lastMouseX = mouseX;
    lastMouseY = mouseY;

    // Determine the attack mode and add bullets accordingly
    switch (currentAttackMode) {
      case TRIANGLE_SHOT:
        if (ammoCount >= TRIANGLE_SHOT_AMMO) {
          // Create the central bullet
          bullets.add(new PoisonBullet(playerX, playerY, angle, maxTriangleShotDamage));

          // Create the left bullet
          float leftBulletAngle = angle + leftBulletOffset;
          bullets.add(new PoisonBullet(playerX, playerY, leftBulletAngle, maxTriangleShotDamage));

          // Create the right bullet
          float rightBulletAngle = angle + rightBulletOffset;
          bullets.add(new PoisonBullet(playerX, playerY, rightBulletAngle, maxTriangleShotDamage));

          ammoCount -= TRIANGLE_SHOT_AMMO;
          lastAmmoRespawnTime = millis();
        }
        break;

      case SINGLE_TRIANGLE_SHOT:
        if (ammoCount >= SINGLE_TRIANGLE_SHOT_AMMO) {
          // Create a single triangle bullet
          bullets.add(new PoisonBullet(playerX, playerY, angle, maxSingleTriangleShotDamage));

          ammoCount -= SINGLE_TRIANGLE_SHOT_AMMO;
          lastAmmoRespawnTime = millis();
        }
        break;
    }
  }
}

// PoisonBullet class
class PoisonBullet {
  float x, y;
  float speed = 10;
  float angle;

  int damage; // Damage value for the bullet

  PoisonBullet(float x, float y, float angle) {
    this.x = x;
    this.y = y;
    this.angle = angle;
    this.damage = 5000; // Default damage for the triangle shot
  }

  PoisonBullet(float x, float y, float angle, int damage) {
    this.x = x;
    this.y = y;
    this.angle = angle;
    this.damage = damage;
  }

  void update() {
    x += cos(angle) * speed;
    y += sin(angle) * speed;
  }

  void display() {
    fill(0, 90, 255); // Blue color for bullets
    pushMatrix();
    translate(x, y);
    rotate(angle - HALF_PI);
    triangle(0, 0, -5, -15, 5, -15);
    popMatrix();
  }

  boolean isOffScreen() {
    return (x < 0 || x > width || y < 0 || y > height);
  }
 
 boolean hitsEnemy(float enemyX, float enemyY, float enemySize) {
  float dx = enemyX + enemySize / 2 - x;
  float dy = enemyY + enemySize / 2 - y;
  float distance = sqrt(dx * dx + dy * dy);
  return distance < enemySize / 2 + 15 / 2; // 15 is the width of the bullet triangle
}
}

from project.clients.adult import Adult
from project.clients.student import Student
from project.loans.mortgage_loan import MortgageLoan
from project.loans.student_loan import StudentLoan


class BankApp:
    loans_granted = []

    VALID_LOANS = {
        'StudentLoan': StudentLoan,
        'MortgageLoan': MortgageLoan
    }

    VALID_CLIENTS = {
        'Student': Student,
        'Adult': Adult
    }

    def __init__(self, capacity: int):
        self.capacity = capacity
        self.loans = []
        self.clients = []

    def add_loan(self, loan_type: str):
        if loan_type not in BankApp.VALID_LOANS.keys():
            raise Exception(f"Invalid loan type!")

        curr_loan = BankApp.VALID_LOANS[loan_type]()
        self.loans.append(curr_loan)

        return f"{loan_type} was successfully added."

    def add_client(self, client_type: str, client_name: str, client_id: str, income: float):
        if client_type not in BankApp.VALID_CLIENTS.keys():
            raise Exception(f"Invalid client type!")

        if len(self.clients) == self.capacity:
            return f"Not enough bank capacity."

        curr_client = BankApp.VALID_CLIENTS[client_type](client_name, client_id, income)
        self.clients.append(curr_client)

        return f"{client_type} was successfully added."

    def grant_loan(self, loan_type: str, client_id: str):
        curr_loan = [l for l in self.loans if l.__class__.__name__ == loan_type][0]
        curr_client = [c for c in self.clients if c.client_id == client_id][0]

        if (curr_loan.__class__.__name__ == "MortgageLoan" and curr_client.__class__.__name__ == "Student") or \
                (curr_loan.__class__.__name__ == "StudentLoan" and curr_client.__class__.__name__ == "Adult"):
            raise Exception(f"Inappropriate loan type!")

        self.loans.remove(curr_loan)
        curr_client.loans.append(curr_loan)
        BankApp.loans_granted.append(curr_loan)

        return f"Successfully granted {loan_type} to {curr_client.name} with ID {client_id}."

    def remove_client(self, client_id: str):
        client = [c for c in self.clients if c.client_id == client_id]

        if not client:
            raise Exception(f"No such client!")
        curr_client = client[0]

        if curr_client.loans:
            raise Exception(f"The client has loans! Removal is impossible!")

        self.clients.remove(curr_client)
        return f"Successfully removed {curr_client.name} with ID {client_id}."

    def increase_loan_interest(self, loan_type: str):
        number_of_changed_loans = 0

        for loan in self.loans:
            if loan.__class__.__name__ == loan_type:
                loan.increase_interest_rate()
                number_of_changed_loans += 1

        return f"Successfully changed {number_of_changed_loans} loans."

    def increase_clients_interest(self, min_rate: float):
        changed_client_rates_number = 0

        for client in self.clients:
            if client.interest < min_rate:
                client.increase_clients_interest()
                changed_client_rates_number += 1

        return f"Number of clients affected: {changed_client_rates_number}."

    def get_statistics(self):
        average_client_interest_rate = 0
        if self.clients:
            average_client_interest_rate = sum([c.interest for c in self.clients]) / len(self.clients)

        return f"Active Clients: {len(self.clients)}\nTotal Income: {sum([c.income for c in self.clients]):.2f}\n" \
               f"Granted Loans: {len(BankApp.loans_granted)}, Total Sum: {sum([l.amount for l in BankApp.loans_granted]):.2f}\n" \
               f"Available Loans: {len(self.loans)}, Total Sum: {sum([l.amount for l in self.loans]):.2f}\n" \
               f"Average Client Interest Rate: {average_client_interest_rate:.2f}"
